- input: "TEXT\x1CC00166710\x1CTEXT-00001\x1C\x1CF3XA\x1CThe Committee is amending
    this report due to a duplicate found in the database for Robert Selby.  When the
    records were combined it caused his May contribution to aggregate in excess of
    $200.  The amended report reflects these changes on the detailed summary pages
    and on Schedule A for line 11a.  Please note that the employees that were disclosed
    on Schedule H4 supporting Line 21(a) as payroll spent less than 25% of their time
    during the period working on Federal Election Activity or activities in connection
    with a Federal Election therefore salary payments were allocable.  This also includes
    fringe benefits for those specific employees.  -    -  Determination of usual
    and normal charges for Enhanced Online Voter File Access for payments received
    on Schedule A, Line 17 of the Committees report was calculated by the total cost
    of developing and hosting our online voter file and dividing it by the number
    of records within the file as well as the presumed number of overall users.  The
    cost to the organization is then determined by the number of records requested
    and the length of time access will be granted.  i.e. Statewide or congressional
    charges are based on the number of records in the district or entire state as
    requested.  -    -   Memo Schedule A's that itemize the committees share of the
    gross contributions received through the joint fundraising activities from the
    ASDC Partnership Program (Association of State Democratic Chairs), and the Democratic
    National Committee Victory Fund are provided on a quarterly basis.    The transfer
    of the joint fundraising proceeds received during this reporting period from the
    \ ASDC Partnership program, and the Democratic National Committee Victory Fund
    represents the committee's share of proceeds for contributions received during
    this or prior reporting periods. The memo entries for these contributions are
    included in this or a prior report of the Committee.\n"
